prompt: "Q: Write python code to solve the following coding problem that obeys the\
  \ constraints and passes the example test cases. The output code needs to read from\
  \ and write to standard IO. Please wrap your code answer using ```:\nLittle Petya\
  \ likes numbers a lot. Recently his mother has presented him a collection of n non-negative\
  \ integers. There's only one thing Petya likes more than numbers: playing with little\
  \ Masha. He immediately decided to give a part of his new collection to her. To\
  \ make the game even more interesting, Petya decided to give Masha such collection\
  \ of numbers for which the following conditions fulfill:\n\n  * Let's introduce\
  \ x1 to denote the xor of all numbers Petya has got left; and let's introduce x2\
  \ to denote the xor of all numbers he gave to Masha. Value (x1 + x2) must be as\
  \ large as possible. \n  * If there are multiple ways to divide the collection so\
  \ that the previous condition fulfilled, then Petya minimizes the value x1. \n\n\
  \n\nThe xor operation is a bitwise excluding \"OR\", that is denoted as \"xor\"\
  \ in the Pascal language and \"^\" in C/C++/Java.\n\nHelp Petya divide the collection\
  \ as described above. If there are multiple suitable ways to divide it, find any\
  \ of them. Please note that after Petya gives a part of his numbers to Masha, he\
  \ may have no numbers left. The reverse situation is also possible, when Petya gives\
  \ nothing to Masha. In both cases we must assume that the xor of an empty set of\
  \ numbers equals 0.\n\nInput\n\nThe first line contains integer n (1 \u2264 n \u2264\
  \ 105), showing how many numbers Petya's mother gave him. The second line contains\
  \ the actual space-separated numbers. They are all integer, non-negative and do\
  \ not exceed 1018.\n\nOutput\n\nPrint n space-separated integers, the i-th of them\
  \ should equal either 1, if Petya keeps the number that follows i-th in his collection,\
  \ or it should equal 2, if Petya gives the corresponding number to Masha. The numbers\
  \ are indexed in the order in which they are given in the input.\n\nExamples\n\n\
  Input\n\n6\n1 2 3 4 5 6\n\n\nOutput\n\n2 2 2 2 2 2\n\n\nInput\n\n3\n1000000000000\
  \ 1000000000000 1000000000000\n\n\nOutput\n\n2 2 2\n\n\nInput\n\n8\n1 1 2 2 3 3\
  \ 4 4\n\n\nOutput\n\n1 2 1 2 2 2 1 2\nA: ```base = [-1] * 60\nhow = [-1] * 60\n\
  who = [-1] * 60\n\nn = int(input())\narr = list(map(int, input().split()))\n\nx\
  \ = 0\nfor a in arr:\n    x ^= a\n\nmapper = [-1] * 60\nind = 59\nind_start = bin(x).count('1')\
  \ - 1\n\nfor bit in reversed(range(60)):\n    if (1 << bit) & x :\n        mapper[bit]\
  \ = ind_start\n        ind_start -= 1\n    else:\n        mapper[bit] = ind\n  \
  \      ind -= 1\n\nfor i in range(len(arr)):\n    temp = 0\n    for bit in range(60):\n\
  \        if (1 << bit) & arr[i]:\n            temp ^= (1 << mapper[bit])\n    arr[i]\
  \ = temp\n\n\n\n\n\nfor i in range(n):\n    x = arr[i]\n    temp_how = 0\n    while\
  \ x > 0:\n        \n        b = x.bit_length() - 1\n        \n        if who[b]!=\
  \ -1:\n            temp_how ^= how[b]\n            x = x ^ base[b]\n        else:\n\
  \            who[b] = i\n            base[b] = x\n            how[b] = temp_how\
  \ | (1 << b)\n            break\n    \n\nx = 0\ntemp = 0\nfor bit in reversed(range(60)):\n\
  \    if (x & (1 << bit) ) == 0 and who[bit] != -1:\n        x ^= base[bit]\n   \
  \     temp ^= how[bit]\n\n#print(base)\n#print(how)\n#print(who)\n\n\nresult = [1]\
  \ * n\nfor j in range(60):\n    if temp & (1 << j):\n        result[who[j]] = 2\n\
  print(*result)```\nQ: Write python code to solve the following coding problem that\
  \ obeys the constraints and passes the example test cases. The output code needs\
