  \ in the following format.\n\n\n$x_1$ $x_2$\n\n\nThe input line provides dragonflies\u2019\
  \ head positions $x_1$ and $x_2$ ($0 \\leq x_1, x_2 \\leq 100$) as integers.\n\n\
  Output\n\nOutput the distance between the two red dragonflies in a line.\n\nExamples\n\
  \nInput\n\n20 30\n\n\nOutput\n\n10\n\n\nInput\n\n50 25\n\n\nOutput\n\n25\n\n\nInput\n\
  \n25 25\n\n\nOutput\n\n0\nA: ```a,b =map(int,(input().split()))\n\nprint(abs(a-b))```\n\
